import React from "react";

const Header = props => {
  return (
    <div className="board-head">
      <div className="flag-count">{props.flagCount}</div>
      <div className="reset">
        <button className="reset-btn" onClick={props.restart}>
          Reset
        </button>
      </div>
    </div>
  );
};

export default Header;
